chat = {

	raw = function(str,targ)
		if targ==0 then targ=nil end
		if tfm.get.room.elevation=="player" then 
			print(str) 
		else 
			tfm.exec.chatMessage(str,targ) 
		end
	end,

	message = function(str,mode,data)

	-- validation / formatting

		mode = mode or 0
		data = data or {}

		if data.cmdFeedback then
			data.cmdFeedback = string.format("<G>: %s</G>",data.cmdFeedback)
		end

	-- -1=debug,0=roomMessage,1=executed commands

		if mode==-1 then 
			if conf.debug then
				chat.raw("<BL><font size='9' face='Verdana'>[<CH2>debug&gt;</CH2> "..str..data.cmdFeedback.."]</font>",data.targ)
			end
		elseif mode==0 then
			chat.raw(str,data.targ)
		elseif mode==1 then
			chat.raw("<BL><font size='9' face='Verdana'>[<VI>"..data.name.."&gt;</VI> !"..str..(data.cmdFeedback or "").."]</font>",data.targ)
		end
	end
}

