function eventChatCommand(name,cmd)
	local cmdFeedback = nil
	local c = { }
    string.gsub(cmd, "%S+", function(arg)
        c[#c + 1] = arg
    end)
	if cmd:sub(1,1)=="!" then eventTextAreaCallback(-1,name,cmd:sub(2)) end
	if c[1] == "noportals" and conf.noportals == false then conf.noportals = true chat.message("<BV>The next maps will no longer have portals.")
	elseif c[1] == "noportals" and conf.noportals == true then conf.noportals = false chat.message("<BV>The next maps will now have portals.") end
	if c[1] == "flymode" and conf.flymode == false then conf.flymode = true chat.message("<BV>It is now possible to fly.")
	elseif c[1] == "flymode" and conf.flymode == true then conf.flymode = false chat.message("<BV>It is no longer possible to fly.") end
	if c[1] == "kill" then tfm.exec.killPlayer(c[2]) end
	if c[1] == "pw" then 
		if c[2] then
			tfm.exec.setRoomPassword(c[2]) 
			chat.message("<BV>The room password is: <CH>"..tostring(c[2])) 
		else
			tfm.exec.setRoomPassword("") 		
			chat.message("<BV>The room's protection has been removed.") 
		end
	end
	if c[1] == "map" then tfm.exec.newGame(eval[tonumber(c[2])]) if c[2] == "random" then tfm.exec.newGame(eval[math.random(-3,48)]) end end
	if c[1] == "choose" then 
		cand=nil
		cand={}
		for k,v in next,players do cand[#cand+1]=k tfm.exec.setNameColor(k,0xc2c2da) end
		catcher = cand[math.random(#cand)] 
		chat.message("<BV>The catcher is: <CH>"..catcher) 
		ui.setShamanName(catcher)
		tfm.exec.setNameColor(catcher,0xeb1d51)
	end
	if c[1] == "map*" then tfm.exec.newGame(eval[tonumber(c[2])],true) if c[2] == "random" then tfm.exec.newGame(eval[math.random(-3,48)],true) end end
	if c[1] == "atlas" then 
		if tonumber(c[2])==nil and c[2] then 
			cmdFeedback = "fail, invalid page number"
			return chat.message(cmd,1,{name=name,cmdFeedback=cmdFeedback})
		end
		atlas(c[2],name) 
	end
	if c[1] == "atlas*" then 
		if tonumber(c[2])==nil and c[2] then 
			cmdFeedback = "fail, invalid page number"
			return chat.message(cmd,1,{name=name,cmdFeedback=cmdFeedback})
		end	
		metadata(c[2],name) 
	end
	if c[1] == "ls" and conf.debug then for k,v in next,_G[c[2]] do chat.message("<BV>"..tostring(k)..": <CH>"..tostring(v)) end end
	if c[1] == "count" and conf.debug then chat.message("<BV>"..tostring(c[2])..": <CH>"..tostring(#_G[c[2]])) end
	if c[1] == "chopt" and conf.debug then chat.message("<BV>optimized: <CH>"..tostring(chopt(c[2]))) end
	chat.message(cmd,1,{name=name,cmdFeedback=cmdFeedback})
end

function chopt(map)
	if tonumber(map) or map==nil then
		map = map or currentMap
		if tostring(eval[map]):find('nosync') then
			return true
		else 
			return false
		end
	end
end

function gui(name)
ui.addTextArea(32, "<font size='10'><p align='center'>"..tostring(thismap).." <BL>|</BL> <J>no portals:<BL> "..tostring(conf.noportals).." <BL>|</BL> <J>mirrored map:<BL> "..tostring(tfm.get.room.mirroredMap).." |</BL> <J>able to fly:<BL> "..tostring(conf.flymode), name, 150, 380, 500, 27, info[currentMap].c or 0x000022, info[currentMap].c or 0x000022, 0.8, true)
ui.addTextArea(64, "<ROSE><a href='event:minimizePanel'><font size='10'>X</a>", nil, 640, 380, 20, 27, 0x000022, 0x000022, 0, true)
end

function mapdata(name,down,etc)
	etc = etc or {}
	displayMap=(etc.map or currentMap)
	if displayMap==-100000000001 then displayMap=0 end
	local col
	if info[displayMap] then
		if info[displayMap].o<=100 then 
			col="V" 
		elseif info[displayMap].o>=101 and info[displayMap].o<=180 then
			col="VP"
		elseif info[displayMap].o>=181 and info[displayMap].o<=240 then
			col="J"
		elseif info[displayMap].o>=241 and info[displayMap].o<=300 then
			col="O"
		elseif info[displayMap].o>=301 then
			col="R"
		else
			col="N"
		end
	end
	if down==true then
		ui.addTextArea(81, "", name, -2600, -1840, 6000, 2000, info[currentMap].c or 0x000022, info[currentMap].c or 0x000022, 0.9,true)
--		ui.addTextArea(82, "", name, 25, 50, 160, 90, 0xffffff, 0x22, 1, true)
		ui.addTextArea(83, "<textformat tabstops='[0,220]'><"..col.."><font size='24'><b>Map "..displayMap.."</b></font></"..col..">\t<font size='13'><b>OPTIMIZED</b></i></font> <font face='Lucida Console'>"..tostring(chopt()).."</font></textformat><br><br><textformat tabstops='[0,40,100,160,220]'><font size='13'><b>WIDTH</b></font> <font face='Lucida Console'>200</font>\t<font size='13'><b>HEIGHT</b></font> <font face='Lucida Console'>200</font>\t<font size='13'><b>OBJECTS</b></font> <font face='Lucida Console'>"..info[currentMap].o.."</font></textformat><br><font size='13'><b>COLOR</b></font> <font face='Lucida Console'><font color='#"..tostring(string.format("%06x",tonumber(info[currentMap].c) or 0x000022)).."'>■</font>"..tostring(string.format("%06x",tonumber(info[currentMap].c) or 0x000022)) or 0x000022.."</font><br><font size='13'><b>DEATH MESSAGE</b></font> <font face='Lucida Console'>Player died</font>", name, 200, 50, 540, 100, 0x324650, 0x0, 0 ,true)
		players[name].ctrl = tfm.exec.addImage(info[displayMap].i,"&"..displayMap,25,50,name)
	else
		for i,v in ipairs({81,82,83}) do ui.removeTextArea(v,name) end
		tfm.exec.removeImage(players[name].ctrl,name)
	end
end

function rmgui(name)
ui.removeTextArea(32,name) 
ui.addTextArea(64, "<ROSE><p align='center'><a href='event:restorePanel'>+</a>", name, 6, 22, 12, 15, info[currentMap].c or 0x000022, info[currentMap].c or 0x000022, 0.8, true)
end

function eventNewPlayer(name)
tfm.exec.bindKeyboard(name,1,true,true)
tfm.exec.bindKeyboard(name,16,false,true)
tfm.exec.bindKeyboard(name,16,true,true)
tfm.exec.bindKeyboard(name,17,false,true)
tfm.exec.bindKeyboard(name,17,true,true)
tfm.exec.bindKeyboard(name,50,true,true)
tfm.exec.bindKeyboard(name,120,true,true)
end

shift={}

function eventKeyboard(n, key, down, x, y)
	if key==1 and conf.flymode == true then tfm.exec.movePlayer(n,0,0,true,0,-17,true) end
	if key==16 then shift[n]=down end
	if key==17 then mapdata(n,down) end
	if key==50 then 
		players[n].c=players[n].c+1
		print("<ROSE>"..players[n].c)
		if players[n].c>1 then
			for k,v in next,players do tfm.exec.setNameColor(k,0xc2c2da) end
			chat.message("<BV>The new catcher is: <CH>"..n) 
			ui.setShamanName(n)
			tfm.exec.setNameColor(n,0xeb1d51)
			players[n].c=0
		end
	end
	if key==120 then for k,v in pairs(tfm.get.room.objectList) do table.insert(objects,k) end tfm.exec.removeObject(objects[math.random(#objects)]) print("<R>*_*") end	
end
function eventNewGame()
	for k,v in next, tfm.get.room.playerList do
    players[k] = {c=0}
	end
    local Ptag = string.match(tfm.get.room.xmlMapInfo.xml, "<P (.-)/>")
    local meta = string.match(Ptag, 'meta ?= ?"(.-)"')
    local mapName
    if meta then
        	mapName = string.gsub(meta, ",", "<BL> - $", 1).."</BL>" end
			thismap = string.gsub("<J>"..tostring(meta), ",", "<BL> - $", 1) print(thismap)
			currentMap = tonumber(string.match(thismap,"%$%K_(.+)")) print(currentMap)
	    ui.setMapName(mapName)
	if Ptag:find('portal') and conf.noportals == false then
		for value in Ptag:gmatch('portal="(.+)"') do
			print(value)            
			tfm.exec.addShamanObject(26,tonumber(value:match('(.-);'):match('(.-),')),tonumber(value:match('(.-);'):match(',(.+)')),0,0,0,false)
			tfm.exec.addShamanObject(27,tonumber(value:match(';(.+)'):match('(.-),')),tonumber(value:match(';(.+)'):match(',(.+)')),0,0,0,false)    
		end
	end
	gui()
	if currentMap==-100000000001 then ui.setMapName("#bodykudo0catch") rmgui() end
	ui.setBackgroundColor("#080808")
end

