			elseif info[i].o>=241 and info[i].o<=300 then
				col="O"
			elseif info[i].o>=301 then
				col="R"
			else
				col="N"
		end
			ui.addTextArea(i%15,"<font size='16'><b><p align='left'><"..col..">Map "..i.."</"..col.."></p></b></font>",targ,(i%5)*160+5,(math.ceil((((i-(page*15))+1)/5))*118)+285,155,23,0x000022,0x000022,0,true)
			ui.addTextArea((i%15)+320,"<font size='16'><p align='right'><N><a href='event:info "..i.."'>ℹ</a><font size='3'> </font></N></p></font>",targ,(i%5)*160+5,(math.ceil((((i-(page*15))+1)/5))*118)+284,155,23,0x000022,0x000022,0,true)
			ICR[#ICR+1] = tfm.exec.addImage(info[i].i,"&"..i,(i%5)*160,(math.ceil((((i-(page*15))+1)/5))*118)+310,targ)
			if conf.debug then chat.message("<CH2>Loaded image "..i.."<G>: "..tostring(info[i].i).." "..tostring((i%5)*160).." "..tostring((math.ceil((((i-(page*15))+1)/5))*118)+310).." "..tostring(i%5)) end
		end
	end
end

function metadata(page,targ)
	page = page or 1
	rmgui(targ)
	display = ""
	for i=0+(page-1)*15,(page-1)*15+14 do 
		if info[i]~=nil then
			local qqq=string.format("%06x",tonumber(info[i].c) or 0x000022)
			display = display..string.format("%s\t%s\t%s\t%s\t\n",
				tostring(i),
				tostring(info[i].o) or "",
				"<font color='#"..tostring(qqq).."'>■</font>"..tostring(qqq) or 0x000022,
				"<font face='Verdana' size='10'>"..tostring(info[i].d).."</font>" or "")
		end
	end
	ui.addTextArea(0, "<p align='center'><font size='11' face='Lucida Console'><ROSE><a href='event:pagem ".. page-1 .."'>[prev]</a><a href='event:pagem ".. page+1 .."'>[next]</a><a href='event:clsgen'>[close]</a></ROSE></font><br>_____________________________________</p><br><font size='11' face='Lucida Console'><textformat tabstops='[0,30,60,120,150]'><D>ID</D>\t<D>OBJ</D>\t<D>COL</D>\t<D>DEATHMSG</D>\n"..display.."</textformat></font>", targ, 112, 50, 576, 320, info[currentMap].c or 0x000022, info[currentMap].c or 0x000022, 0.65, true)
end

